import { Link } from "react-router-dom";
import iphone from "./images/iphone.png";

function ProductCard() {
    return (
        <div className="cardContainerIphone">
            
            <img src={iphone}></img>
            <h4>iPhone 15 Pro Max</h4>
            <p>256GB</p>
            <Link><button>Buy</button></Link>
        </div>
    )
}

export default ProductCard;
